import React from "react";
import "./header.css";
// import logo from "../../../public/img/logo.png";

export const Header = () => {
    return (

        <div className="header">
            <div className="logout">
                <img className="logout"
                     src="https://icons.iconarchive.com/icons/alecive/flatwoken/256/Apps-Dialog-Shutdown-icon.png"
                     alt="logout"/>
                {/*<i className="large material-icons">settings_power</i>*/}
            </div>
            <h1><img className="logo" src="https://www.homesteadletters.com/wp-content/uploads/2010/07/yck7BoXcE.jpeg" alt=""/></h1>
        </div>
    )
};
